INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 108401, 3, "私は人々の平和を守るため、唱喚術を使って\n戦います。…最近は、ア、アイドルとしても\n活動してますが、そちらはまだ不慣れで…", "カルミナ", "人々を守るために歌う、唱喚士の少女", "O", "各種楽器", "福原綾香", 0, 6, 17, 4, "チカ（クリスマス）", 46, 163);
INSERT INTO `v1_67fd18aeb6dbee71bf6a2cf96bf766f62e4b4a86e3545a36b4cf9024a48e2125` VALUES ("ヒューマン", 108501, 9, "あの、えっと…私、く、クルミですぅ…\nふ、ふぇぇぇ…ど、どうしようぅ…\nは、恥かしくて…ご、ごめんなさいぃぃ！", "サレンディア救護院", "泣き虫で臆病な守ってあげたい女の子", "B", "観劇、おままごと", "植田佳奈", 0, 6, 12, 9, "クルミ（クリスマス）", 40, 150);
